import Fotos from './Fotos';
import Uri from './Uri';

const Homepage = () => {
  return (
    <>
      <div className="Uri container">
        <Uri />
      </div>
      <div className="website container">
        <Fotos />
      </div>
    </>
  );
};
export default Homepage;
